-- run `source /path/to/weather_database.sql` from the mysql CLI to load this db into mysql

CREATE DATABASE IF NOT EXISTS weather_database;
USE weather_database;

CREATE TABLE IF NOT EXISTS Users(
	userId int unsigned,
	name varchar(16) UNIQUE NOT NULL,
	PRIMARY KEY(userId)
);
CREATE TABLE IF NOT EXISTS Admins(
	adminId int unsigned,
	userId int unsigned,
	name varchar(16) UNIQUE NOT NULL,
	PRIMARY KEY(adminId),
	FOREIGN KEY(userId) REFERENCES Users(userId)
);


CREATE TABLE IF NOT EXISTS Days(
	dt Date NOT NULL,
	tavg float,
	tmin float,
	tmax float,
	prcp float,
	snwd float,
	PRIMARY KEY(dt)
);

